import jwt from "jsonwebtoken";
import db from "../models"

const middleware = {
  verifyToken: async(req, res, next) => {
    const token = req.query.access_token;

    if (token) {
      try {
        const user_id = jwt.verify(token, "password");
        await db.User.findOne({ id: user_id })
        .then(() => next())
        .catch((err) => res.status(500).json({ message: err }))
      } catch (error) {
        res.status(403).json({ message: "token ht hn" })
      }
    } else res.status(401).json({ message: "token khng hp l!" })
  },
  check_manager: (req, res, next) => {
    if (req.data[0].role == 1) next();
    else res.status(401).json({ message: "khng  quyn truy cp" });
  },
  check_admin: (req, res, next) => {
    if (req.data[0].role == 2) next();
    else res.status(401).json({ message: "khng  quyn truy cp" });
  }
}
module.exports = middleware

